create table hotel (
	hotel_id INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	hotel_name VARCHAR(17) NOT NULL,
	hotel_phone VARCHAR(50) NOT NULL,
	hotel_email VARCHAR(50) NOT NULL,
	hotel_address VARCHAR(50) NOT NULL,
	hotel_city VARCHAR(8) DEFAULT 'New York',
	website VARCHAR(34) NOT NULL,
	rating VARCHAR(20) NOT NULL,

	FOREIGN KEY (rating) REFERENCES star (rating),
	UNIQUE (hotel_phone),
    UNIQUE (hotel_email),
    UNIQUE (hotel_address),
    UNIQUE (website)
);
